import React from 'react';
import {Route} from 'react-router-dom';
import './App.css';
import FormikChefOnboarding from './ChefLogin';
// import FormikChefPosting from './ChefPostPage';

function App() {
  return (
    <div className="App">
      <FormikChefOnboarding />
      <Route exact path='/' component={ChefLogin} />
      <Route exact path='/chefposts' component={ChefPostPage} />
    </div>
  );
}

export default App;
